// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

import "../meta-transactions/ContentMixin.sol";
import "../meta-transactions/NativeMetaTransaction.sol";

contract OwnableDelegateProxy {}

contract ProxyRegistry {
    mapping(address => OwnableDelegateProxy) public proxies;
}


contract Dinosaur is ERC721, ContextMixin, NativeMetaTransaction, Ownable {
    using SafeMath for uint256;

    string constant public LASTEST_VERSION = "v1.0.1";
    string constant public META_DATA_EXTENSION = ".json";

    uint256 public TOTAL_SUPPLY;
    address public PROXY_REGISTRY_ADDRESS;

    constructor(
        string memory _name, string memory _symbol, address _proxyRegistry
    ) ERC721(_name, _symbol) {
        _initializeEIP712(_name);
        PROXY_REGISTRY_ADDRESS = _proxyRegistry;
    }

    function totalSupply() public view returns (uint256) {
        return TOTAL_SUPPLY;
    }

    function baseTokenURI() public pure returns (string memory) {
        return "https://bafybeibcml2iwtpnjv252dt4wbg4qpcpdhj6ilpfu3sa23yykldpiurhpa.ipfs.nftstorage.link/";
    }

    function tokenURI(
        uint256 _tokenId
    ) override public pure returns (string memory) {
        return string(abi.encodePacked(baseTokenURI(), Strings.toString(_tokenId), META_DATA_EXTENSION));
    }

    function _msgSender() internal override view returns (address sender) {
        return ContextMixin.msgSender();
    }

    function isApprovedForAll(
        address owner, address operator
    ) override public view returns (bool) {
        ProxyRegistry proxyRegistry = ProxyRegistry(PROXY_REGISTRY_ADDRESS);
        if (address(proxyRegistry.proxies(owner)) == operator) {
            return true;
        }

        return super.isApprovedForAll(owner, operator);
    }

    function mintTokenTo(address _to, uint256 _tokenId) public onlyOwner {
        _safeMint(_to, _tokenId);
        TOTAL_SUPPLY = TOTAL_SUPPLY.add(1);
    }
}
